import React, { Component } from 'react'
import Carro from './Carro';

class ResultadoBusqueda extends Component{

    mostrarCarro = () => {
        
     const carros = this.props.carros;


     console.log(carros);

     return (

    <React.Fragment>
        <div className="col-12 p-5 row">
            { carros.map}

        </div>
    </React.Fragment>
  )

    }

    render() {

        return (

            <React.Fragment>
               { this.mostrarCarros() }
               </React.Fragment>
 


        );

        
    }
}
export default ResultadoBusqueda;
